import React from 'react';
import styled from 'styled-components';

const ForecastWrapper = styled.div`
background: red;
`
const ForecastDay = (props) => {
  const { temp, icon, main } = props
  return (
    <ForecastWrapper>
      {temp}
      {icon}
      {main}
    </ForecastWrapper>
  )
}

export default ForecastDay;
